import React, { FC } from 'react';
import Layout from 'components/global/layout';
import './styles.scss';
import { IProps } from 'components/global/postItem';

export const PublicTransport: FC<IProps> = () => (
  <Layout title="PublicTransport" description="This is the PublicTransport Page">
    <label htmlFor="title">Article Title:</label> <br />
    <input type="text" id="title" placeholder="Enter Article title" />
    <br />
    <br />
    <label htmlFor="body">Article content:</label> <br />
    <input  className="input2" type="text" id="body" placeholder="Enter Article Content" />
  </Layout>
);

export default PublicTransport;
